import Hero from "./components/Hero";

function App() {
  return (
    <>
      <div
        style={{ background: "linear-gradient(135deg,#ff1b6b,#45caff)" }}
        // style={{ background: "black" }}
      >
        <Hero />
        {/* <Nav /> */}
        <Cards />
      </div>
      <Contact />
      <Footer />
    </>
  );
}
export default App;
